B.Go=new A.bk(B.cN,['O "Eu" Real vs. O "Eu" Online',"Quem \xe9 Voc\xea no Feed? A Batalha Secreta entre o Seu \u201cEu\u201d Real e a Sua Persona Online",'Sabe aquela vida perfeita do Insta, cheia de filtros e sorrisos? \xc9 fake! A gente cria um "personagem" online que \xe9 mais feliz e bonito, mas acaba se sentindo mal por n\xe3o ser assim na vida real. A real \xe9 que t\xe1 todo mundo cansado de perfei\xe7\xe3o. Ser voc\xea mesmo, com bagun\xe7a e tudo, \xe9 o que realmente bomba.',"Se a vida fosse um perfil no Instagram, todo mundo teria filtro bonito, legenda inspiradora e um p\xf4r do sol de fundo. Mas\u2026 e fora da tela? Ser\xe1 que o \u201cvoc\xea\u201d do feed \xe9 o mesmo que o \u201cvoc\xea\u201d do espelho? \n\nA real \xe9 que vivemos em uma era em que \u201cser visto\u201d parece quase t\xe3o importante quanto ser. Cada curtida \xe9 tipo um mini aplauso, e cada story \xe9 uma chance de mostrar que t\xe1 tudo bem \u2014 mesmo quando n\xe3o t\xe1. Aos poucos, sem nem perceber, criamos uma vers\xe3o editada de n\xf3s mesmos: mais sorridente, mais interessante, mais bonita, mais feliz. Um personagem que parece sa\xeddo direto de um comercial da vida perfeita. \n\nE a culpa n\xe3o \xe9 s\xf3 nossa. Os filtros e algoritmos d\xe3o uma for\xe7a. Um retoque aqui, uma luz ali, e pronto: a pele fica lisa, o sorriso brilha e o que era um dia normal vira um \u201cdia incr\xedvel\u201d. Mas o problema \xe9 quando a gente come\xe7a a acreditar que s\xf3 essa vers\xe3o \xe9 boa o suficiente pra ser mostrada.\n\nA\xed vem a compara\xe7\xe3o: o corpo da influencer, a viagem do amigo, o namoro do casal do TikTok\u2026 e, do outro lado, o nosso reflexo real, que parece \u201cmenos\u201d. \xc9 o efeito colateral do mundo filtrado: quanto mais perfeito o feed, mais dif\xedcil \xe9 aceitar as imperfei\xe7\xf5es da vida fora dele. \n\nSegundo psic\xf3logos, isso afeta a autoimagem e a identidade. A gente come\xe7a a medir o pr\xf3prio valor pelos n\xfameros do perfil \u2014 curtidas, visualiza\xe7\xf5es, seguidores. O que antes era divers\xe3o vira press\xe3o. E o pior: quanto mais tentamos sustentar o \u201ceu online\u201d, mais distante ficamos do \u201ceu verdadeiro\u201d. \n\nMas calma \u2014 n\xe3o \xe9 sobre deletar o Instagram e fugir pro mato (apesar de tentador \xe0s vezes). \xc9 sobre encontrar equil\xedbrio. Mostrar quem voc\xea \xe9 de verdade pode ser libertador. Postar uma foto sem filtro, um dia ruim, um pensamento sincero. O p\xfablico perfeito n\xe3o existe \u2014 e t\xe1 tudo bem. \n\nPorque, no fim das contas, o que as pessoas mais querem ver \xe9 gente de verdade. E o \u201cvoc\xea\u201d real, com suas bagun\xe7as e vulnerabilidades, \xe9 muito mais interessante do que qualquer vers\xe3o filtrada.","https://i.giphy.com/QMHoU66sBXqqLqYvGO.webp"],t.l)
B.Gp=new A.bk(B.cN,['"Aesthetics" e a Identidade Padronizada',"A Ditadura do \u201cCore\u201d: De \u201cClean Girl\u201d a \u201cE-Boy\u201d, o TikTok t\xe1 escolhendo seu estilo por voc\xea?",'Voc\xea \xe9 clean girl, dark academia ou e-boy? O TikTok t\xe1 ditando seu estilo? Esse texto mostra como essas "tribos" s\xe3o divertidas pra se inspirar, mas viram uma pris\xe3o quando voc\xea tem que se encaixar 100% nelas (e comprar tudo o que elas mandam). A dica \xe9: misture tudo! O melhor "core" (centro) \xe9 o seu.',"Abre o TikTok e rola um pouquinho o feed: pronto, j\xe1 \xe9 bombardeado por mil est\xe9ticas diferentes \u2014 clean girl, balletcore, dark academia, soft girl, cottagecore, e-boy, barbiecore\u2026 cada uma com uma vibe, uma paleta de cores e um jeitinho de se vestir. Parece um desfile infinito, e a sensa\xe7\xe3o \xe9 de que, se voc\xea n\xe3o se encaixa em uma delas, t\xe1 fora de moda. Mas ser\xe1 que o TikTok t\xe1 ajudando a gente a descobrir nosso estilo \u2014 ou s\xf3 colocando todo mundo dentro de caixinhas novas? \n\nPra come\xe7ar, o termo \u201caesthetic\u201d vem do ingl\xeas e significa \u201cest\xe9tico\u201d \u2014 mas na internet virou bem mais do que isso. Agora, \xe9 sin\xf4nimo de identidade visual: como voc\xea se veste, o que posta, como decora seu quarto e at\xe9 o tipo de m\xfasica que ouve. \xc9 o seu \u201cpacote visual\u201d pronto pra ser compartilhado nos reels e nos v\xeddeos do TikTok. \n\nE o mais louco \xe9 que essas aesthetics s\xe3o quase como \u201ctribos digitais\u201d. A soft girl, por exemplo, ama tons pastel, blush rosa e uma vibe fofa. J\xe1 o pessoal da dark academia curte roupas mais s\xf3brias, caf\xe9s, livros e aquele ar misterioso de filme antigo. O e-boy e a e-girl trazem a energia do mundo gamer e dos anos 2000, com cabelo preto, delineador e corrente no pesco\xe7o. E o cottagecore \xe9 a fuga pra um mundo calmo e buc\xf3lico \u2014 cheio de flores, vestidos e piqueniques de mentira no jardim. \n\nAt\xe9 a\xed, tudo bem. Brincar com estilo \xe9 super legal \u2014 \xe9 uma forma de se expressar, testar coisas novas e descobrir o que combina com voc\xea. Afinal, quem nunca quis se reinventar um pouco depois de ver um v\xeddeo inspirador, n\xe9? O problema come\xe7a quando o \u201ctestar\u201d vira \u201cseguir \xe0 risca\u201d. Quando a est\xe9tica deixa de ser divers\xe3o e vira regra. \n\nDe repente, voc\xea sente que precisa usar aquele look, comprar aquela roupa, usar aquele filtro\u2026 tudo pra \u201cpertencer\u201d ao grupo da vez. E o que era pra ser liberdade vira press\xe3o \u2014 de consumo, de apar\xeancia e at\xe9 de identidade. \xc9 tipo: se voc\xea n\xe3o se encaixa 100% no estilo, parece que t\xe1 fazendo errado. \n\nE tem mais: o algoritmo ajuda a refor\xe7ar essa sensa\xe7\xe3o. Se voc\xea curte v\xeddeos clean girl, o TikTok vai te mostrar ainda mais clean girls. Em pouco tempo, voc\xea acha que esse \xe9 \u201co \xfanico jeito certo\u201d de ser estilosa. S\xf3 que, na real, o estilo n\xe3o precisa ser uma est\xe9tica pronta \u2014 pode ser uma mistura de v\xe1rias, ou algo que n\xe3o tem nome nenhum. \n\nEnt\xe3o, bora combinar uma coisa? Em vez de deixar o TikTok decidir quem voc\xea \xe9, use as est\xe9ticas pra se inspirar, n\xe3o pra se limitar. Mistura tudo! Um toque balletcore aqui, uma energia dark academia ali, um cabelo e-girl s\xf3 por divers\xe3o. A gra\xe7a \xe9 criar um visual que conte a sua hist\xf3ria, e n\xe3o repetir a de algu\xe9m. \n\nO \u201ccore\u201d que mais importa \xe9 o seu \u2014 o que vem de dentro, sem precisar de r\xf3tulo, sem precisar de filtro. ","https://i.imgur.com/LvUdwVi.jpeg"],t.l)
B.Gl=new A.bk(B.cN,["Compara\xe7\xe3o, Ansiedade e FOMO","Check-in: Por que rolar o feed te deixa pra baixo? Entendendo a ansiedade de compara\xe7\xe3o e o FOMO",'Sabe quando voc\xea rola o feed e parece que todo mundo t\xe1 viajando ou numa festa incr\xedvel, menos voc\xea? Isso tem nome: FOMO (Medo de Ficar de Fora). O texto explica como a compara\xe7\xe3o com o "melhor momento" dos outros (que \xe9 sempre editado) detona nossa autoestima e gera ansiedade. Lembrete: ningu\xe9m posta o dia ruim.',"Voc\xea j\xe1 percebeu como \xe0s vezes, depois de um tempinho rolando o feed, bate uma sensa\xe7\xe3o esquisita? Tipo um misto de ansiedade, tristeza e a impress\xe3o de que a vida dos outros \xe9 mil vezes mais interessante que a sua? Pois \xe9 \u2014 isso tem nome e at\xe9 sigla: FOMO, ou Fear of Missing Out, que significa \u201cmedo de estar perdendo algo\u201d. \n\nEsse sentimento aparece quando a gente v\xea todo mundo em festas, viajando, namorando ou \u201cvivendo o melhor momento\u201d \u2014 e sente que est\xe1 ficando pra tr\xe1s. E o pior: quanto mais tempo a gente passa nas redes, mais ele aparece. Porque, convenhamos, o TikTok, o Insta e o X (ex-Twitter) s\xe3o quase projetados pra isso. O feed nunca acaba, as notifica\xe7\xf5es piscam o tempo todo, e o algoritmo sabe exatamente o que mostrar pra te prender ali. \xc9 tipo um labirinto digital onde cada v\xeddeo \xe9 feito pra te segurar por mais alguns segundos. \n\nO problema \xe9 que, no meio disso tudo, rola uma compara\xe7\xe3o social constante \u2014 mesmo sem a gente perceber. Voc\xea v\xea algu\xe9m com o corpo \u201cperfeito\u201d, viajando pra lugares incr\xedveis ou num relacionamento dos sonhos, e come\xe7a a pensar que a sua vida \xe9 meio sem gra\xe7a. Mas o que ningu\xe9m lembra \xe9 que o que aparece no feed \xe9 s\xf3 o destaque, o \u201cmelhor \xe2ngulo\u201d, o momento mais bonito. Ningu\xe9m mostra a briga que teve, a ansiedade antes da viagem ou o dia que passou chorando. \n\nE a\xed, quando a compara\xe7\xe3o vira rotina, aparecem os efeitos: ansiedade, autoestima baixa, sensa\xe7\xe3o de n\xe3o estar \xe0 altura dos outros. A mente come\xe7a a acreditar que \u201ct\xe1 todo mundo vivendo mais\u201d \u2014 menos voc\xea. A\xed vem a culpa, o medo de perder algo, e o ciclo continua: voc\xea entra nas redes pra relaxar, mas sai ainda mais tenso. \n\nO algoritmo ajuda nisso tamb\xe9m, viu? Ele entende o que te faz ficar mais tempo e joga exatamente esse tipo de conte\xfado na sua tela. Se voc\xea v\xea v\xeddeos de viagens, vai aparecer mais viagem. Se curte fotos de corpos malhados, vem mais corpo malhado. No fim, voc\xea acaba num looping de compara\xe7\xe3o sem perceber. \n\nMas calma \u2014 d\xe1 pra sair disso. O primeiro passo \xe9 dar check-in em voc\xea mesmo. Que tal colocar limites no tempo de uso? Tipo: nada de redes na hora das refei\xe7\xf5es ou antes de dormir. Outra boa \xe9 fazer uma limpa no feed: siga gente que te inspira, n\xe3o quem te deixa se sentindo mal. D\xe1 pra usar as redes de um jeito leve, pra se divertir e se conectar, n\xe3o pra se comparar o tempo todo. \n\nE o mais importante: lembra que ningu\xe9m posta a vida toda, s\xf3 os melhores momentos. A sua vida real \u2014 com dias bons, ruins, engra\xe7ados ou entediantes \u2014 tamb\xe9m vale muito. \xc0s vezes, o que voc\xea precisa n\xe3o \xe9 postar mais, e sim viver mais fora da tela. \n\nEnt\xe3o, da pr\xf3xima vez que der vontade de abrir o app pra ver \u201co que est\xe3o fazendo\u201d, pensa: voc\xea quer se informar ou t\xe1 com medo de estar perdendo algo? Porque, no fim das contas, voc\xea n\xe3o t\xe1 perdendo nada \u2014 s\xf3 precisa dar play na sua pr\xf3pria hist\xf3ria.","https://i.giphy.com/QYQ3PZ9UHje3S.webp"],t.l)
B.Gm=new A.bk(B.cN,["Encontrando sua Tribo","Encontre Sua Galera: Como as redes sociais ajudam a achar comunidades e construir sua identidade","Cansado de se sentir um E.T. na vida real? A internet pode ser seu ref\xfagio! O texto mostra o lado bom das redes: achar comunidades (fandoms, grupos de games, espa\xe7os LGBTQIA+, Discord) onde voc\xea pode ser 100% voc\xea, sem julgamento. \xc9 sobre achar gente que te entende de verdade e se sentir parte de algo.","Voc\xea j\xe1 parou pra pensar que, no meio de tanta compara\xe7\xe3o, filtro e cobran\xe7a por likes, as redes tamb\xe9m podem ser o lugar onde voc\xea finalmente se sente em casa? \xc9 meio doido, mas \xe9 verdade: a internet, que \xe0s vezes parece um campo minado de ansiedade, tamb\xe9m pode ser um ponto de encontro pra quem passa a vida inteira procurando onde se encaixar. \n\nTodo mundo quer pertencer a algum lugar. S\xf3 que, pra muita gente, esse \u201clugar\u201d n\xe3o \xe9 a escola, nem a rua, nem a pr\xf3pria fam\xedlia \u2014 \xe9 um grupo online. Pode ser um fandom no Twitter (ou X), um servidor no Discord, uma p\xe1gina de memes, um f\xf3rum sobre livros ou um espa\xe7o de apoio pra quem \xe9 LGBTQIA+. Ali, a conversa flui, o julgamento some e, de repente, voc\xea percebe que tem um monte de gente que pensa e sente igualzinho a voc\xea. \n\nDe acordo com o Nexo Jornal, as redes sociais s\xe3o cada vez mais importantes pra construir esse senso de pertencimento, principalmente entre adolescentes. Elas funcionam como um tipo de companhia digital \u2014 um lugar onde d\xe1 pra ser quem voc\xea \xe9, sem precisar se encaixar nos padr\xf5es da vida offline. Muita gente que se sente \u201cestranha\u201d ou \u201cdiferente\u201d fora da tela encontra na internet pessoas que entendem o que ela vive. E isso faz toda a diferen\xe7a. \n\nTem tamb\xe9m o lado de quem usa as redes pra descobrir o que acredita. Uma pesquisa da USP mostrou que os jovens est\xe3o cada vez mais engajados em temas sociais e pol\xedticos por causa da internet. Grupos, hashtags e movimentos online deram voz a quem antes n\xe3o era ouvido. Quando voc\xea se junta a uma comunidade que defende algo em que acredita \u2014 seja meio ambiente, igualdade, representatividade ou cultura pop \u2014, percebe que sua opini\xe3o tem for\xe7a. Que voc\xea faz parte de algo maior. \n\nE o mais interessante \xe9 que essas conex\xf5es nem sempre s\xe3o sobre \u201camizade perfeita\u201d ou \u201crelacionamento ideal\u201d. \xc0s vezes, \xe9 s\xf3 sobre ser compreendido. Voc\xea desabafa sobre algo dif\xedcil e algu\xe9m responde: \u201cCara, eu tamb\xe9m passei por isso\u201d. E pronto \u2014 ali nasce um tipo de la\xe7o que vai muito al\xe9m de likes ou views. \xc9 o poder de se sentir visto. \n\nClaro, nem tudo \xe9 leve. Existe o lado t\xf3xico das redes: compara\xe7\xf5es, discursos de \xf3dio, desinforma\xe7\xe3o. Mas o fato \xe9 que tamb\xe9m existe um outro lado \u2014 o lado da troca, da empatia e do aprendizado. As redes s\xe3o um espelho, sim, mas tamb\xe9m s\xe3o uma janela: atrav\xe9s delas, a gente conhece pessoas, ideias e realidades que ampliam nossa vis\xe3o do mundo. \n\nO segredo \xe9 saber onde e com quem voc\xea se conecta. Sabe aquela timeline que s\xf3 te deixa pra baixo? D\xe1 pra limpar. Segue quem te inspira, interage com quem te escuta, busca os espa\xe7os que te fazem bem. A internet \xe9 enorme, e h\xe1 um cantinho pra cada tipo de pessoa. \n\nNo fim das contas, \u201cencontrar sua galera\u201d n\xe3o \xe9 sobre seguir tend\xeancia ou tentar se encaixar. \xc9 sobre achar pessoas que te lembram que t\xe1 tudo bem ser quem voc\xea \xe9 \u2014 mesmo que o mundo offline ainda n\xe3o entenda. \xc9 perceber que o digital, quando usado do jeito certo, n\xe3o afasta: aproxima. \n\nEnt\xe3o, da pr\xf3xima vez que abrir o app, em vez de pensar \u201cquantos likes isso vai dar?\u201d, tenta se perguntar: \u201cquem eu posso conhecer hoje que me fa\xe7a sentir mais eu?\u201d. Porque, no meio de tantos perfis, hashtags e timelines infinitas, a melhor conex\xe3o que voc\xea pode fazer \xe9 aquela que te faz sentir parte de algo verdadeiro.","https://i.giphy.com/3o6Zt1baiJDGSbJANa.webp"],t.l)
B.Gn=new A.bk(B.cN,[u.x,u.x,"Voc\xea vive pra postar ou nem lembra que tem Insta? Esse quiz r\xe1pido (com perguntas sobre seus h\xe1bitos) te ajuda a descobrir seu perfil: \n\ud83d\udc51 Rei/Rainha do Feed: Ama uma trend, vive online, mas cuidado com a press\xe3o! \n\ud83d\ude0e De Boa na Rede: Sabe o equil\xedbrio perfeito entre curtir online e offline. \n\ud83e\uddd8 Mestre do Detox: Sua vida real \xe9 muito mais interessante que o feed.",'Na selva das redes sociais, cada um sobrevive de um jeito. Tem quem poste at\xe9 o que comeu no caf\xe9 da manh\xe3 e tem quem apare\xe7a uma vez por ano. Qual \xe9 o seu perfil? \n\nPegue um papel ou o bloco de notas e anote os pontos de cada resposta. Vamos l\xe1! \n\nA primeira coisa que voc\xea faz ao acordar \xe9: \nA) Abrir o Instagram ou o TikTok para ver as novidades, antes mesmo de levantar da cama. (10 pontos) \nB) Dar uma olhada r\xe1pida no WhatsApp, ver se tem algo urgente, e depois levantar. (20 pontos) \nC) Levantar, tomar banho, comer... o celular fica pra depois. (30 pontos \n\nVoc\xea est\xe1 num rol\xea muito legal com seus amigos (festa, praia, shopping). Voc\xea: \nA) Grava TUDO. Faz stories de cada momento, uma live, e j\xe1 pensa na legenda do carrossel que vai postar. (10 pontos) \nB) Tira algumas fotos com a galera no come\xe7o, posta um story marcando o pessoal e depois guarda o celular pra curtir. (20 pontos) \nC) Esquece que o celular existe. O momento \xe9 real demais para ficar na tela. (30 pontos) \n\nNa hora de postar uma selfie, voc\xea: \nA) Testa uns 10 filtros diferentes, edita a luz, a cor, talvez at\xe9 uma leve corre\xe7\xe3o. S\xf3 posta quando est\xe1 100% perfeito. (10 pontos) \nB) Usa um filtro que voc\xea gosta, mais para ajustar a luz ou dar um "clima" (aesthetic) para a foto. (20 pontos) \nC) Posta a foto "crua" ou, na maioria das vezes, nem posta selfie. (30 pontos) \n\nSeu post "flopou" (teve poucas curtidas ou visualiza\xe7\xf5es). Qual sua rea\xe7\xe3o? \nA) Fico mal e frustrado(a). Penso seriamente em apagar o post. (10 pontos) \nB) Ah, que pena. Mas tudo bem, eu gostei da foto, ent\xe3o ela fica l\xe1. (20 pontos) \nC) "Flopou" o qu\xea? Eu nem olho o n\xfamero de curtidas. (30 pontos) \n\nVoc\xea est\xe1 se sentindo meio pra baixo num s\xe1bado \xe0 noite. O que voc\xea faz? \nA) Abro o Instagram. Acabo me sentindo pior ao ver todo mundo em festas, parecendo super feliz. (10 pontos) \nB) Dou uma olhada, mas fecho o app se come\xe7o a me comparar. Sei que ali \xe9 s\xf3 o "melhores momentos" dos outros. Prefiro ver uma s\xe9rie. (20 pontos) \nC) Nem abro rede social. Vou conversar com um amigo no privado, ouvir m\xfasica ou ler um livro. (30 pontos) \n\nComo \xe9 o seu "feed" de quem voc\xea segue? \nA) Sigo milhares de pessoas. Influencers, famosos, subcelebridades, gente que nem conhe\xe7o... n\xe3o posso perder nada! (10 pontos) \nB) Sigo meus amigos, artistas que eu curto, e algumas contas de meme ou de assuntos que eu gosto (livros, games, esportes). (20 pontos) \nC) Meu feed \xe9 "limpo". Sigo s\xf3 meus amigos mais pr\xf3ximos e pouqu\xedssimas contas de interesse. (30 pontos) \n\nVoc\xea j\xe1 sentiu que precisava comprar algo (uma roupa, uma maquiagem) s\xf3 porque viu no TikTok? \nA) Sim! Toda hora. Se \xe9 trend, eu sinto que preciso ter para me encaixar na "aesthetic". (10 pontos) \nB) \xc0s vezes acho bonito, salvo como inspira\xe7\xe3o, mas s\xf3 compro se eu realmente gostar e estiver precisando. (20 pontos) \nC) Muito dif\xedcil. Meu estilo sou eu quem fa\xe7o, n\xe3o o For You. (30 pontos) \n\n\n[RESULTADOS DO QUIZ] \n\nSome seus pontos e descubra seu perfil! \n\nSe voc\xea fez entre 70 e 110 pontos: \n\nPerfil: REI / RAINHA DO FEED  \nVoc\xea \xe9 a "main character" (personagem principal) das suas redes! Voc\xea sabe todas as trends, seu feed \xe9 impec\xe1vel e voc\xea entende tudo de engajamento. Voc\xea usa as redes para construir ativamente quem voc\xea \xe9 online. \nO Ponto de Aten\xe7\xe3o: Cuidado! Ser o rei ou rainha do feed \xe9 cansativo. Essa press\xe3o para ser "perfeito" e "interessante" o tempo todo pode afetar sua autoestima. \nA Dica: Tente se perguntar: "Estou postando isso porque eu gostei ou porque os outros v\xe3o gostar?". Lembre-se: sua identidade real vale muito mais que qualquer like. \n\nSe voc\xea fez entre 120 e 170 pontos: \n\nPerfil: DE BOA NA REDE (O NAVEGADOR CONSCIENTE) \nVoc\xea encontrou o equil\xedbrio! Voc\xea gosta de postar, de interagir e de ver o que est\xe1 rolando, mas sua vida offline vem primeiro. Voc\xea sabe que o feed \xe9 um recorte (e muitas vezes editado) da vida. \nO Ponto de Aten\xe7\xe3o: Voc\xea est\xe1 no caminho certo. Seu desafio \xe9 manter esse equil\xedbrio. \xc9 f\xe1cil se deixar levar pela rolagem infinita ou pela "bad" da compara\xe7\xe3o. \nA Dica: Continue fazendo essa "limpa" no seu feed. D\xea unfollow ou "silencie" contas que te fazem sentir mal. Seu feed deve ser um lugar leve! \n\nSe voc\xea fez entre 180 e 210 pontos: \n\nPerfil: MESTRE DO DETOX \nVoc\xea \xe9 um ponto fora da curva. Voc\xea entendeu que as redes sociais s\xe3o uma ferramenta, e n\xe3o o centro da sua vida. Voc\xea raramente se compara e prefere viver os momentos a registr\xe1-los. \nO Ponto de Aten\xe7\xe3o: Nenhum! Voc\xea provavelmente tem uma rela\xe7\xe3o bem saud\xe1vel com a tecnologia. As redes n\xe3o parecem afetar a constru\xe7\xe3o da sua identidade. \nA Dica: Voc\xea \xe9 inspira\xe7\xe3o! Mas lembre-se que as redes tamb\xe9m t\xeam seu lado bom, como conectar com amigos que est\xe3o longe ou achar comunidades com seus mesmos interesses. Use para o bem!',"https://i.giphy.com/fnufS3lCf9vc4scYOr.webp"],t.l)
B.Gq=new A.bk(B.cN,['Detox Digital e "Higiene" Online',"Manual de Sobreviv\xeancia Online: 5 Dicas para Usar o Instagram e o TikTok sem Pirar",'Ningu\xe9m vai largar o celular, ent\xe3o como usar sem ficar ansioso? O texto d\xe1 5 dicas de ouro: \n\n1. Silencie notifica\xe7\xf5es pra ter paz. \n2. D\xea "unfollow" (ou silencie) quem te faz sentir mal. \n3. Lembre-se: At\xe9 o "Close Friends" \xe9 performance (todo mundo edita a vida). \n4. Crie momentos sem tela (ex: antes de dormir). \n5. Use a net pra se conectar de verdade, n\xe3o s\xf3 pra se comparar.',"Ok, sejamos sinceros: ningu\xe9m vai simplesmente \u201clargar o celular\u201d. A internet faz parte da vida real \u2014 \xe9 onde a gente estuda, se diverte, conhece gente nova e at\xe9 desabafa. Mas, \xe0s vezes, o scroll infinito d\xe1 um bug na cabe\xe7a: ansiedade, compara\xe7\xe3o, FOMO\u2026 tudo vem junto no combo. Ent\xe3o, que tal um detox digital realista? Tipo um spa mental pra quem vive online, sem precisar virar ermit\xe3o digital. \n\nAnota a\xed o manual de sobreviv\xeancia online \u2014 5 passos pra usar as redes sem ser usado por elas. \n\n1. Silencie pra se ouvir. \nN\xe3o \xe9 drama: as notifica\xe7\xf5es s\xe3o feitas pra te viciar. Cada \u201cping\u201d \xe9 um mini golpe de dopamina que te faz querer voltar pro app. Ent\xe3o, bora virar o jogo? Silencia as notifica\xe7\xf5es que n\xe3o importam. Assim, voc\xea escolhe quando entrar \u2014 e n\xe3o o contr\xe1rio. \n\n2. Fa\xe7a um \u201cclean\u201d no seu feed. \nSabe aquele perfil que te faz se sentir mal com o corpo, com a vida ou com a roupa que voc\xea t\xe1 usando? Unfollow sem culpa. Seu feed precisa inspirar, n\xe3o drenar sua energia. E se n\xe3o quiser deixar de seguir, d\xe1 pra usar o \u201csilenciar\u201d \u2014 a vers\xe3o educada do \u201ct\xf4 de saco cheio\u201d. \n\n3. Lembre-se: at\xe9 o \u201cClose Friends\u201d \xe9 performance. \nSim, at\xe9 os stories mais \xedntimos s\xe3o montados. Todo mundo filtra o que mostra (e o que esconde). Ent\xe3o, quando ver algu\xe9m \u201cvivendo o sonho\u201d, lembra que ningu\xe9m posta a parte chata do dia. Todo mundo t\xe1 tentando parecer um pouquinho mais feliz online. \n\n4. Estabele\xe7a zonas offline. \nN\xe3o precisa virar hippie digital \u2014 s\xf3 crie momentos sem tela. Tipo: nada de TikTok no caf\xe9 da manh\xe3 ou de rolar o feed antes de dormir. D\xe1 um tempo pro seu c\xe9rebro respirar. \xc9 nesses espa\xe7os que voc\xea realmente processa as coisas \u2014 e at\xe9 tem boas ideias. \n\n5. Use a internet como ponte, n\xe3o pris\xe3o. \nConverse, troque ideias, aprenda algo novo. A internet \xe9 incr\xedvel quando usada pra se conectar de verdade. Ent\xe3o, em vez de s\xf3 consumir, produza algo: um texto, uma arte, um v\xeddeo sincero. Deixe a rede trabalhar a seu favor, n\xe3o o contr\xe1rio. \n\nA meta n\xe3o \xe9 \u201csumir das redes\u201d \u2014 \xe9 aprender a viver bem com elas. Fazer um detox digital n\xe3o \xe9 desconectar do mundo, \xe9 reconectar com voc\xea. E, spoiler: isso \xe9 muito mais trend do que parece.","https://i.giphy.com/A0n9AuwyUgPwlNtOxN.webp"],t.l)
